In DORM, you define your business entities by creating a Table. A Table is associated with a physical DataSource and a table. Tables will also contain Fields, Conditions, Joins etc. Lets start with a simple example: use dorm::prelude::*; let products = Table::new("product", postgres.clone()) .with_field("name") .with_field("description") .with_field("default_price"); Tables are created by calling Table::new() and passing it a table name and a DataSource. let products = Table::new("product", postgres.clone()) The following invocations to with_field() are going to replace your "table" instance with a new one. Our original code is equivalent to: let products = products.with_field("name");
let products = products.with_field("description");
let products = products.with_field("default_price"); If you prefer to mutate your table, you can use add_field() instead: let mut products = Table::new("product", postgres.clone());
products.add_field("name");
products.add_field("description");
products.add_field("default_price"); You will see the above method chaining used quite often in DORM. In most cases both methods will have the identical arguments, but please check with the documentation.

