As the name implies, ExpressionAarc keeps its parameters inside an Arc and therefore parameters can be dynamic objects. Anything that implements SqlChunk trait can be used as a parameter. Naturally both Expression and ExpressionArc implement SqlChunk, but there are more types that implement SqlChunk trait and we will look at them later. ExpressionArc can be created through a expr_arc! macro: let expression = expr_arc!("SELECT * FROM product WHERE name = {}", "DeLorian Doughnut");
writeln!(expression.preview()); // renders into: SELECT * FROM product WHERE name = 'DeLorian Doughnut' You can now pass expresisons recursively: let condition = expr_arc!("name = {}", "DeLorian Doughnut");
let expression = expr_arc!("SELECT * FROM product WHERE {}", condition);
writeln!(expression.preview()); // renders into: SELECT * FROM product WHERE name = 'DeLorian Doughnut' You might have noticed, that nested expressions are not escaped, but rest assured, parameters are never inserted into the SQL query. Both Expression and ExpressionArc can cloned and passed around freely.

