As you can see in the example above, SqlChunk can have many sub-objects. When we need to send off expression to the database, we need to flattern it. SqlChunk trait has a render_chunk() method that will convert itself into a static Expression type: let condition = expr_arc!("name = {}", "DeLorian Doughnut");
let expression = expr_arc!("SELECT * FROM product WHERE {}", condition);
let flattened = expression.render_chunk(); dbg!(flattened.sql());
dbg!(flattened.params()); // renders into: SELECT * FROM product WHERE name = {}
// params: [json!("DeLorian Doughnut")] In the example above, we used render_chunk() method on ExpressionArc to convert it into a static Expression type. Then sql() and params() methods can be called to get the final template and parameters. Template has correctly combined nested condition, while leaving parameter value separated.

