A query object is designed as a template engine. It contains maps of various columns, conditions, joins etc. Query implements SqlChunk and query itself can be contained inside expression or another query. Query implements wide range of "with_*" methods that can be used to manipulate the query. Lets create a query that will select all columns from "product" table, where name is "DeLorian Doughnut" and age is greater than 30: let expr1 = expr!("name = {}", "John");
let expr2 = expr!("age > {}", 30); let query = Query::new() .with_table("users", None) .with_column_field("id") .with_column_field("name") .with_condition(expr1) .with_condition(expr2); writeln!(query.preview()); // renders into: SELECT id, name FROM users WHERE name = 'John' AND age > 30 Query does not know anything about the underlying database and therefore cannot execute itself. It can only be rendered into a template and parameters. Query is immutable calling with_* methods will take the ownership, modify and return a new instance, making it perfect for chaining. Methods like with_condition can accept any argument that implements SqlChunk trait, lets create another query, based on the one we had above: // query is from example above
let query2 = Query::new() .with_table("orders", None) .with_condition(expr_arc!("user_id in {}", query .clone() .without_columns() .with_column_field("id") )); writeln!(query2.preview()); // renders into: SELECT * FROM orders WHERE user_id in (SELECT id, name, age FROM users WHERE name = 'John' AND age > 30) Importantly - the two parameters which were set (and then cloned) for the query are kept separate from a final query rendering and will be passed into DataSource separately. This ensures that SQL injection is never possible. Next, lets explore some other kinds of SqlChunk implementation, that are more intuitive to use over Expressions.

